window.bookSummaryJSON = "<p><b>The assassins of Barry Eisler’s #1 bestseller </b><b><i>The Killer Collective</i></b><b> are back - and this time, it’s chaos. </b></p> <p>Assistant US Attorney Alondra Diaz hates traffickers. And she’s determined to put one of America’s most powerful financiers, Andrew Schrader, in prison forever for his crimes against children. </p> <p>But Schrader has videos implicating some of the most powerful members of the US national security state. To eliminate Diaz, the powers that be bring in a contractor: Marvin Manus, an implacable assassin whose skills have been forged in intelligence, the military, and the hardest prisons. </p> <p>Enter former Marine sniper Dox and black-ops veteran Daniel Larison with an unusual assignment: not to kill Diaz, but to keep her alive.</p> <p>A lot of players are determined to acquire the videos and the blackmail power they represent. But with Seattle sex-crimes detective Livia Lone, “natural causes” killer John Rain, and ex-Mossad honey-trap specialist Delilah, the good guys might just have a chance.</p> <p>They’re not going to play by anyone else’s rules. They’re not going to play by any rules at all. They want a different kind of fight. The chaos kind.</p>"; 
